These forecasts have three main purposes:
•they provide a framework for presenting the economic context in which the budget is developed;
•most of the economic aggregates or their sub-components are used in the modelling of taxation and other revenue lines; and
•forecasts of nominal gross state product (GSP) are used to express key financial aggregates in relation to the size of the economy, such as non-financial public sector net debt to nominal GSP.
The spreadsheet below contains the seven published aggregates for the budget papers (Budget and Budget Update):
•real GSP growth;
•level of nominal GSP;
•employment growth;
•unemployment rate;
•growth in the consumer price index;
•growth in the wage price index; and
•annual population growth.

This WAMSI project was carried out between March 2008 and March 2010 project and had 5 general objectives:


To characterise the western coastal geological and aquifer structure;   


To characterise the hydrogeology the western coastal plain and availability of potable water;   


To characterise the coastal seawater/freshwater interface, and its behaviour in relation to seasonal fluctuations, tidal and episodic events (eg. cyclones);


To determine the physico-chemical structure of the freshwater/saltwater system;


To determine the pathways of groundwater discharge to the Ningaloo Reef lagoon, and physical and/or benthic ‘signals’ of discharge, by remote sensing and ground truth studies.
